import "./FilledTeamSlot.css";

const FilledTeamSlot = ({pokemon, currentTeam, setCurrentTeam}) => {
    return (
        <div className={"filledTeamSlot"} onClick={() => setCurrentTeam([...currentTeam].splice(currentTeam.indexOf(pokemon), 1))}>
            <div className={"slotContent"}>
                <img className={"filledSlotImage"} src={pokemon.image}/>
            </div>
        </div>
    );
}

export default FilledTeamSlot;
